import React from "react";

const Movies = ({ genres }) => {
  return (
    <div className="d-flex btn-group">
      {genres.map((genre) => (
        <label className="btn" htmlFor="btncheck1" key={genre.id}>
          {genre.name}
          <input
            type="checkbox"
            className="btn-check"
            id="btncheck1"
            autoComplete="off"
          ></input>
        </label>
      ))}
    </div>
  );
};

export default Movies;
